import React, { useState, useEffect } from "react";
import axios from "axios";
import "../styles.css";

export default function AdminDashboard() {
  const [formData, setFormData] = useState({
    uid: "",
    nombre: "",
    numeroBoleta: "",
    numeroPlaca: "",
  });

  const [fotos, setFotos] = useState({
    fotoPerfil: null,
    fotoVehiculo: null,
  });

  const [alumnos, setAlumnos] = useState([]);

  useEffect(() => {
    async function fetchAlumnos() {
      try {
        const response = await axios.get("http://localhost:5000/alumnos");
        setAlumnos(response.data);
      } catch (error) {
        console.error("Error al obtener alumnos", error);
      }
    }
    fetchAlumnos();
  }, []);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleFileChange = (e) => {
    setFotos({ ...fotos, [e.target.name]: e.target.files[0] });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!formData.uid) {
      alert("El UID es obligatorio.");
      return;
    }

    const formDataObj = new FormData();
    Object.keys(formData).forEach((key) => {
      formDataObj.append(key, formData[key]);
    });
    Object.keys(fotos).forEach((key) => {
      if (fotos[key]) formDataObj.append(key, fotos[key]);
    });

    try {
      await axios.post("http://localhost:5000/alumnos", formDataObj, {
        headers: { "Content-Type": "multipart/form-data" },
      });
      alert("Alumno registrado exitosamente");
      setFormData({ uid: "", nombre: "", numeroBoleta: "", numeroPlaca: "" });
      setFotos({ fotoPerfil: null, fotoVehiculo: null });

      const response = await axios.get("http://localhost:5000/alumnos");
      setAlumnos(response.data);
    } catch (error) {
      alert("Error al registrar el alumno");
    }
  };

  return (
    <div className="admin-container">
      <h1>Panel de Administración</h1>
      <form onSubmit={handleSubmit} className="admin-card">
        <input type="text" name="uid" placeholder="UID del Alumno" value={formData.uid} onChange={handleChange} required />
        <input type="text" name="nombre" placeholder="Nombre Completo" value={formData.nombre} onChange={handleChange} required />
        <input type="text" name="numeroBoleta" placeholder="Número de Boleta" value={formData.numeroBoleta} onChange={handleChange} required />
        <input type="text" name="numeroPlaca" placeholder="Número de Placa" value={formData.numeroPlaca} onChange={handleChange} required />

        <label>Foto de Perfil:</label>
        <input type="file" name="fotoPerfil" accept="image/*" onChange={handleFileChange} required />

        <label>Foto del Vehículo:</label>
        <input type="file" name="fotoVehiculo" accept="image/*" onChange={handleFileChange} required />

        <button type="submit" className="admin-button">Registrar</button>
      </form>

      <h2>Alumnos Registrados</h2>
      <ul>
        {alumnos.map((alumno) => (
          <li key={alumno.uid}>
            {alumno.nombre} - {alumno.numeroBoleta} - {alumno.uid}
            <br />
            <img src={`http://localhost:5000/uploads/${alumno.fotoPerfil}`} alt="Perfil" width="50" />
            <img src={`http://localhost:5000/uploads/${alumno.fotoVehiculo}`} alt="Vehículo" width="50" />
          </li>
        ))}
      </ul>
    </div>
  );
}
